import React from "react";
import { Navigate, Route, Routes } from "react-router-dom";
import BookingPage from "../components/01/BookingPage";
import PhotoPage from "../components/01/PhotoPage";

function Router() {
  return (
    <Routes>
      <Route path="*" element={<Navigate to="/01" />} />
      <Route path="/01" element={<PhotoPage />} />
      <Route path="/bookings" element={<BookingPage />}>
        <Route path="thisweek" element={<BookingPage />}>
          <Route path=":roomId" element={<BookingPage />} />
        </Route>
        <Route path="nextweek" element={<BookingPage />}>
          <Route path=":roomId" element={<BookingPage />} />
        </Route>
        <Route path="wholemouth" element={<BookingPage />}>
          <Route path=":roomId" element={<BookingPage />} />
        </Route>
      </Route>
    </Routes>
  );
}

export default Router;
